<script>
export default {
  data() {
    return {
      checked: true,
      checkedLang: true,
      langs: ["heb", "ru"],
      checkedLangName: "HEB"
    };
  },
  methods: {
    setLocale(locale){
        this.$i18n.locale = locale;
        this.$router.push({
            params :{lang : locale} 
        })
    },
    toggleCheckbox() {
      this.doThis()
      this.checkbox = !this.checkbox;
      this.$emit("setCheckboxVal", this.checkbox);
    },
    toggleCheckboxLang() {
      if (this.checkedLangName === "HEB") {
        let locale = 'heb'
        this.setLocale(locale)
        this.checkedLangName = "RU";
      } else {
        let locale = 'ru'
        this.setLocale(locale)
        this.checkedLangName = "HEB";
      }
      this.checkbox = !this.checkbox;
      this.$emit("setCheckboxVal", this.checkbox);
    },
    async doThis() {
      if(this.checked){
        document.body.classList.add("night")
      }else{
        document.body.classList.remove("night")
      }
    }
  }
};
</script>

